import {useState} from 'react';
function FruitForm() {
	const [fruit,setFruit] = useState({Fruit:'',Price:0})
	const handleChangeFor = (propertyName) => (event) => {
	  const newFruit = {
		...fruit,
		[propertyName]: event.target.value
	  };
	  this.setState({ contact: newFruit });
	}
	  return (
		<div>
		  <input type="text" onChange={handleChangeFor('Fruit')} value={fruit.Fruit}/>
		  <input type="text" onChange={handleChangeFor('Price')} value={fruit.Price}/>
		</div>
	  );
	}
  export default FruitForm;
